import React, {useState} from 'react'

export const Counter = () => {
    const [prevState, setPrevState] = useState(0)

const plsHandler = (e)=>{
    setPrevState += 1;
   
}

  return (
    <div>
        <h2>Counter</h2>
        <p>{prevState}</p>
        <button onClick={plsHandler}>+</button>
        <button>-</button>
    </div>
    
  )
}
